import React, { Component } from 'react'

export default class ImportItem extends Component {
    componentDidMount(){
        console.log("props"+JSON.stringify(this.props));
    }
    render() {
        return (
            <li className="list-group-item border-0 d-flex justify-content-between ps-0 mb-2 border-radius-lg">
            <div className="d-flex align-items-center">
              <button className="btn btn-icon-only btn-outline-success mb-0 me-3 p-3 btn-sm d-flex align-items-center justify-content-center">
              <i class="bi bi-receipt"></i>
              </button>
              <div className="d-flex flex-column">
                <h6 className="mb-1 text-dark text-sm">Netflix</h6>
                <span className="text-xs">
                  27 March 2020, at 12:30 PM
                </span>
              </div>
            </div>
            <div className="d-flex align-items-center text-danger text-gradient text-sm font-weight-bold">
              - $ 2,500
            </div>
          </li>
        )
    }
}
